import React from 'react';
import styled from 'styled-components';
import './App.css';

const HomePage = styled.div`
  display: flex;
  flex-direction: column;
`;

const Header = styled.header`
  align-self: stretch;
  height: 56px;
  position: relative;
  background-color: white;
  display: none;
  z-index: 0;
`;

const Logo = styled.img`
  height: 155px;
  width: 155px;
  position: relative;
  object-fit: cover;
  z-index: 1;
`;

const Nav = styled.div`
  display: flex;
  flex-direction: row;
  box-sizing: border-box;
  max-width: 100%;
`;

const NavItem = styled.a`
  text-decoration: none;
  position: absolute;
  top: 0;
  left: 0;
  color: inherit;
  display: inline-block;
  z-index: 1;
  ${({ left }) => left && `left: ${left};`}
`;

const NavGroup = styled.div`
  display: flex;
  align-items: flex-start;
  justify-content: flex-start;
  gap: 3rem;
`;

const NavContainer = styled.div`
  width: 309px;
  display: flex;
  flex-direction: column;
  padding: 0.5rem 0 0;
  box-sizing: border-box;
`;

const Button = styled.button`
  cursor: pointer;
  border: 0;
  padding: 0.5rem 1rem 0.5rem 0.5rem;
  background-color: gray;
  border-radius: 0.25rem;
  display: flex;
  flex-direction: row;
  align-items: flex-start;
  justify-content: flex-start;
  z-index: 1;
  &:hover {
    background-color: #525252;
  }
`;

const ButtonLabel = styled.a`
  text-decoration: none;
  font-size: 1rem;
  font-family: 'Khula', sans-serif;
  color: white;
  text-align: left;
  display: inline-block;
  min-width: 38px;
  z-index: 2;
`;

const Section = styled.section`
  display: flex;
  align-items: flex-start;
  justify-content: flex-start;
`;

const ExploreColleges = styled.div`
  display: flex;
  flex-direction: column;
  align-items: flex-start;
  justify-content: flex-start;
`;

const Title = styled.h1`
  margin: 0;
  height: 68px;
  width: 533px;
  font-size: 2.5rem;
  font-family: 'Changa One', sans-serif;
  display: inline-block;
  flex-shrink: 0;
`;

const ProductInfo = styled.div`
  display: flex;
  flex-direction: column;
`;

const ProductCard = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
`;

const ProductImage = styled.img`
  width: 100%;
`;

const SearchSection = styled.section`
  display: flex;
  align-items: center;
  justify-content: center;
  padding: 1rem 0;
`;

const SearchInput = styled.input`
  padding: 0.5rem;
  width: 100%;
  max-width: 500px;
  border: 1px solid gray;
  border-radius: 0.25rem;
`;

const TestimonialsSection = styled.section`
  display: flex;
  flex-direction: column;
  align-items: flex-start;
  justify-content: flex-start;
  padding: 1rem;
`;

const Testimonial = styled.div`
  display: flex;
  align-items: center;
  margin-bottom: 1rem;
`;

const Avatar = styled.img`
  width: 50px;
  height: 50px;
  border-radius: 50%;
  margin-right: 1rem;
`;

const TestimonialText = styled.div`
  display: flex;
  flex-direction: column;
`;

const TestimonialName = styled.span`
  font-weight: bold;
`;

const TestimonialCourse = styled.span`
  color: gray;
`;

function App() {
  return (
    <HomePage>
      <Header />
      <Nav>
        <Logo src="./public/05e80a463c964d6a9eb7e1eaae60cd53-l0-00115-6-2024--9-10-43-amremovebgpreview-1@2x.png" alt="" />
        <NavContainer>
          <NavGroup>
            <NavItem>Home</NavItem>
            <NavItem left="76px">About Us</NavItem>
          </NavGroup>
          <NavItem>Guidance Registration</NavItem>
        </NavContainer>
        <Button>
          <ButtonLabel>Login</ButtonLabel>
        </Button>
        <Button>
          <ButtonLabel>Sign Up</ButtonLabel>
        </Button>
      </Nav>
      <Section>
        <ExploreColleges>
          <Title>
            Explore 1000+ colleges and universities
            <br />
            and choose whatâ€™s best
            <br />
            for YOU
          </Title>
          <ProductImage src="./public/whatsapp-image-20240805-at-112019removebgpreview-1@2x.png" alt="" />
        </ExploreColleges>
        <ProductInfo>
          <Button>
            <ButtonLabel>Get Started</ButtonLabel>
          </Button>
          <Button>
            <ButtonLabel>Explore Colleges</ButtonLabel>
          </Button>
        </ProductInfo>
      </Section>
      <Section>
        <Title>Explore products</Title>
        <ProductCard>
          <ProductImage src="./public/vector-7@2x.png" alt="" />
          <Title>SPOT ROUND ADMISSION</Title>
          <p>Info about what the product does</p>
          <Button>
            <ButtonLabel>EXPLORE</ButtonLabel>
          </Button>
        </ProductCard>
        <ProductCard>
          <ProductImage src="./public/vector-71@2x.png" alt="" />
          <Title>COLLEGE PREDICTOR</Title>
          <p>Info about what the product does</p>
          <Button>
            <ButtonLabel>EXPLORE</ButtonLabel>
          </Button>
        </ProductCard>
        <ProductCard>
          <ProductImage src="./public/vector-4.svg" alt="" />
          <Title>SPOT ROUND ADMISSION</Title>
          <p>Info about what the product does</p>
          <Button>
            <ButtonLabel>EXPLORE</ButtonLabel>
          </Button>
        </ProductCard>
      </Section>
      <ProductImage src="./public/rectangle-11@2x.png" alt="" />
      <SearchSection>
        <SearchInput placeholder="search for colleges, courses and more..." />
      </SearchSection>
      <TestimonialsSection>
        <Title>Words of Gratitude</Title>
        <Testimonial>
          <Avatar src="./public/avatar.svg" alt="" />
          <TestimonialText>
            <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Suspendisse congue quam cursus metus maximus, in commodo leo consectetur. Aliquam erat volutpat. Nullam enim mauris, tincidunt eget nisi sed, sagittis mollis dolor. Morbi egestas neque</p>
            <TestimonialName>student name</TestimonialName>
            <TestimonialCourse>course</TestimonialCourse>
          </TestimonialText>
        </Testimonial>
      </TestimonialsSection>
    </HomePage>
  );
}

export default App;
